drop table if exists edit.poi;
drop table if exists edit.poi_simple;
drop table if exists edit.districts;
drop table if exists edit.fclass;


create table edit.fclass
(
    id          integer not null primary key,
    name_de     text    not null,
    name_en     text    not null,
    description text default null
);

create table edit.poi
(
    id          serial not null primary key,
    name        text   not null,
    updated     date    default null,
    code        integer default null,
    active      boolean,
    image       bytea   default null,
    description text    default null,
    geom        geometry(Point, 3857),
    classid     int,
    foreign key (classid) references edit.fclass (id)
);

create table edit.poi_simple
(
    id          serial not null primary key,
    name        text   not null,
    updated     date    default null,
    code        integer default null,
    active      boolean,
    image       bytea   default null,
    description text    default null,
    geom        geometry(Point, 3857)
);


create table edit.districts
(
    sid         text not null primary key,
    name        text not null,
    description text default null,
    geom        geometry(MultiPolygon, 3857)
);


